import React from 'react';
import Menu4 from "./menu4";
import Warranty from './Warranty';
import Warranty2 from './Warranty2';
import Warranty3 from './Warranty3';
import Warranty4 from './Warranty4';




const TakuuPage = () => {
    return (
        <div>
            <Menu4/>
            <h1>Takuu ehdot.</h1>
            <Warranty/>
            <Warranty2/>
            <Warranty3/>
            <Warranty4/>

        </div>
    );
}

export default TakuuPage;
